export class ExamenPhysique {
    ExamenId: number;
    IdVisite: number;
    Poid: number;
    Taille: number;
    Pc?: number;
    Rate?: number;
    Foie?: number;
    Ictere: boolean;
    UrinesRouges: boolean;
    DysmorphirFaciale: boolean;
    FrequenceRespiration: number;
    FrequenceCardiaque: number;
    PaSystolique: number;
    PaDiastolique: number;
    Auscultation: string;
    Preciser?: string;
    AutreAnomalies: boolean;
    PreciserAnemalie?: string;
  
    constructor() {
      this.ExamenId = 0;
      this.IdVisite = 0;
      this.Poid = 0;
      this.Taille = 0;
      this.Pc = 0;
      this.Rate = 0;
      this.Foie = 0;
      this.Ictere = false;
      this.UrinesRouges = false;
      this.DysmorphirFaciale = false;
      this.FrequenceRespiration = 0;
      this.FrequenceCardiaque = 0;
      this.PaSystolique = 0;
      this.PaDiastolique = 0;
      this.Auscultation = '';
      this.Preciser = '';
      this.AutreAnomalies = false;
      this.PreciserAnemalie = '';
    }
  }
